import React from 'react';
import { Link } from 'react-router-dom';  // We'll use React Router for navigation between pages

const Header = () => {
  return (
    <header style={{ position: 'sticky', top: 0, backgroundColor: '#f8f9fa', padding: '10px', zIndex: 100 }}>
      <nav>
        <ul style={{ display: 'flex', justifyContent: 'space-around', listStyle: 'none', padding: 0 }}>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/portfolio">Portfolio</Link></li>
          <li><Link to="/about">About</Link></li>
          <li><Link to="/contact">Contact</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
